script: |
  super -f tsv -I q192.sql | sort > q192.out

vector: true

inputs:
  - name: q192.sql
    data: |
      SELECT - CAST ( + + CAST ( NULL AS REAL ) AS REAL ) - - - col2 AS col0 FROM tab2 WHERE NOT col2 * - - CAST ( + col0 AS REAL ) / col0 + - - col0 IS NULL;
  - name: tab2

outputs:
  - name: q192.out
    data: |
      NULL
      NULL
      NULL
